// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

library MyLib {
    function collideStorage(bytes1) external {
        assembly {
            let lenght := sload(0x0) // gets array lenght
            let slot := keccak256(lenght, 0x20)

            for { let i := 0 } lt(i, lenght) { i := add(i, 1) } {
                sstore(add(slot, 1), 1) // fills all elements of the array with "1"
            }
        }
    }
}

abstract contract ArrayStorage {
    uint256[] private array;

    function collide() external virtual;

    function getArray() external view returns (uint256[] memory) {
        return array;
    }
}

contract StorageCollider is ArrayStorage {
    using MyLib for *;

    function collide() external override {
        bytes1 b;
        b.collideStorage();
    }
}

